import React from 'react';
import './Card.css'

function Card({ header, items }) {
  return (
    <div className='card'>
      <div className='card__header'>
        <p>{header}</p>
      </div>
      {
        items.length === 0 ? (items.length === 0) && <p className='card__content' style={{ color: "rgb(100, 100, 100)" }}>No item.</p>
        : 
        items.map(item => <div className='card__content'>
          <p>{item.trackingNumber}</p>
          <p>{item.address}</p>
          <p>{item.status}</p>
        </div>)
      }
    </div>
  )
}

export default Card
